INSERT INTO `fg_extension` (`ext_id`, `unique_id`, `heading`, `sub_heading`, `extension_img`, `category`, `html_text`, `single_planid`) VALUES
(1, 'stripe', 'Stripe', '', 'no_img', 'payment', 's:951:\"The Stripe Extension helps you to collect online payments through your forms. &lt;br&gt;\n\nAdd a payment field in the form and do the &lt;a href=&quot;https://www.formget.com/stripe-payment-forms/&quot; target=&quot;_blank&quot; title=&quot;Collect Payment using Stripe &quot;&gt;required settings for Stripe Extension&lt;/a&gt; to make your form ready to collect payments.&lt;br/&gt;&lt;br/&gt;\n\nWith Stripe extension you can :\n&lt;ul&gt;\n&lt;li&gt; Accept credit card payments through forms instantly.&lt;/li&gt;\n&lt;li&gt; Create different kinds of online forms that accepts payments.&lt;/li&gt;\n&lt;li&gt; It calculates down the total amount dynamically based on the form field amount and perform the checkout.&lt;/li&gt;\n&lt;li&gt; Sign up your users for one time or recurring payments.&lt;/li&gt;\n&lt;li&gt;You can collect payment for single (by adding radio button field) and multiple products  (by adding checkbox field).&lt;/li&gt;\n&lt;/ul&gt;\";', 'a:1:{i:0;s:1:\"1\";}');
